import React, {Component} from 'react';
import Page1 from './components/Page1';

import {Route, Switch} from 'react-router-dom';
import './App.css';


class App extends Component {



  render(){
    return (
    <div >
        <Switch>
            <Route exact path='/' render={(routeProps)=> <Page1 {...routeProps} onFormSubmit={this.handleSubmit} videos={this.state.videos} /> } /> 


        </Switch>




    </div>
  );

 }

}

export default App;
